import "./portfolio.scss";

export default function Portfolio() {
  return (
    <div className="portfolio" id="portfolio">
      <h1>Portfolio</h1>
      <ul>
        <li>Featured</li>
        <li>Web App</li>
        <li>Mobile App</li>
        <li>Responsive</li>
        <li>front-End</li>
        <li>Development</li>
      </ul>
      <div className="container"></div>
    </div>
  );
}
